const markDownsDefaultState = {
  markdowns: [],
  columnHeaders: {},
};

export default (state = markDownsDefaultState, action) => {
  switch (action.type) {
    case 'SET_MARK_DOWNS':
      return {
        ...state,
        markdowns: action.value,
      };
    case 'SET_MD_COLUMN_HEADERS':
      return {
        ...state,
        columnHeaders: action.value,
      };
    default:
      return {
        ...state,
      };
  }
};
